import { Component, Prop, Vue } from 'vue-property-decorator';

@Component
export default class Signup extends Vue {
  username = '';
  password = '';
  submitted = false;

  get usernameValid() {
    return true;
  }
  get passwordValid() {
    return true;
  }
}
